You have lots of good series in your planning list but here's one I personally loved:

https://anilist.co/anime/108465/Mushoku-Tensei-Jobless-Reincarnation/

In order of importance, I'd say:
- Read as many reviews as you can;
- Don't stretch it. Don't use fancy words just because you know them. Keep it short and get to the point. People's attention is low. If you bore them for one sentence, you've lost them.
- Split you review in paragraphs, but not necessarily in parts (story, soundtrack etc);
- Pay attention to the style (e.g.: well-used punctuation, no grammar errors, some __bold__ and some _italic_ words. Maybe add a character's quote?)
